import {Grid, Cell} from 'react-mdl';

class About extends Component{
    render(){
        return(
            <div>
                <Grid>
                    <Cell col={4}>
                        <div style={{textAlign:'center'}}>
                        <img 
                            src="https://cdn1.iconfinder.com/data/icons/user-pictures/100/female1-512.png"
                            alt="avatar"
                            style={{height:'200px'}}
                        />
                        </div>
                        <h2 style={{paddingTop:'2em'}}> Laura Pognante</h2>
                        <h4 style={{color:'grey'}}>Estudiante avanzada de Ingenier√≠a de Sistemas</h4>
                        <hr style={{borderTop:'3px solid #833fb2', width:'50%'}}/>
                        <p>Soy una persona responsable, comprometida, con gran capacidad de trabajo en equipo. Con iniciativa de resolver problemas y lograr metas. Con muchas ganas de trabajar y aprender.</p>
                    </Cell>
                    <Cell className="about-rigth-col" col={8}>
                        Rigth Side
                    </Cell>
                </Grid>

            </div>
        )
    }
}

export default About;
